// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ERC20.sol";

contract StupidToken is ERC20 {
    mapping(address => uint256) balances;
    mapping(address => mapping(address => uint256)) approved;

    function name() public pure override returns (string memory) {
        return "Stupid Token";
    }

    function symbol() public pure override returns (string memory) {
        return "ST";
    }

    function decimals() public pure override returns (uint8) {
        return 3;
    }

    function totalSupply() public pure override returns (uint256) {
        return 1000;
    }

    function balanceOf(address _owner)
        public
        view
        override
        returns (uint256 balance)
    {
        return balances[_owner];
    }

    modifier checkAddressBalance(address _address, uint256 _value) {
        require(balances[_address] != 0 && balances[_address] >= _value);
        _;
    }

    function transfer(address _to, uint256 _value)
        public
        override
        returns (bool success)
    {
        return transferFrom(msg.sender, _to, _value);
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) public override returns (bool success) {
        if (balances[_from] >= _value) {
            balances[_from] -= _value;
            balances[_to] += _value;
        } else if (allowance(_from, _to) >= _value) {
            approved[_from][_to] -= _value;
            balances[_to] += _value;
        }

        emit Transfer(_from, _to, _value);

        return true;
    }

    function approve(address _spender, uint256 _value)
        public
        override
        checkAddressBalance(msg.sender, _value)
        returns (bool success)
    {
        balances[msg.sender] -= _value;
        approved[msg.sender][_spender] = _value;

        emit Approval(msg.sender, _spender, _value);

        return true;
    }

    function allowance(address _owner, address _spender)
        public
        view
        override
        returns (uint256 remaining)
    {
        return approved[_owner][_spender];
    }
}
